import './basket.css'
const Basket=({style,itemsArray})=>{
    let className=""
if(style){
    className+=" hide"
}
console.log(itemsArray)
const elements=itemsArray.map(item=>{
    const {icon,...itemProps}=item
          return (
    
        <div className="navItem" key={icon}>
            <div>
                {/* <img src={mas[icon]} alt="icon"/>  */}
                {item.model}                   
            </div>
            <div>{item.price}</div>
        </div>
    )
})
    return(
        <div className={className}>
            {elements}
        </div>
    )
}
export default Basket
